"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 09 Aug 2018 20:34:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1227:\"\n						\n						<p>Replies: 0</p>\n						<p>Google XML sitemaps did an auto-update yesterday for my site at 0915am. At the same time, google console sent me an email advising that there was a new owner of my site and if I did not recognise this owner, who is <a href=\"mailto:sametkeya@gmail.com\" rel=\"nofollow\">sametkeya@gmail.com</a>, I should consider it a hack and find out how they accessed the site and &#8216;fix&#8217; it. I am unable to deactivate the hack owner on google console as the hack has written a meta tag which I cannot find in the web source to remove. This hack has allowed a registered admin on WordPress which I have managed to delete but as yet, I can&#8217;t find the meta tag to remove it from the site which would then allow me to unverify the hack site owner. It seems too coincidental that the google update and hack were done at the same time.</p>\n<p>Can anyone help me find the meta tag,&lt;meta name=&#8221;google-site-verification&#8221; content=&#8221;BDN0zFuyJ69AfA6NjJSbyS03oGTFxTFnBIDuC3p-buQ&#8221; /&gt; on my website and help me remove it. I am not a programmer and can only do basis cpanel things, so I&#8217;d be grateful for all assistance.</p>\n<p>many thanks<br />\nRuth</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"ruthduncan\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:67:\"\n					\n					\n					\n					\n					\n\n					\n					\n\n					\n					\n					\n				\";s:7:\"