INSERT INTO `wp1_posts` VALUES (7,1,'2018-06-02 01:58:13','2018-06-01 18:58:13','<h1><strong>substr</strong></h1>\r\n<strong>substr</strong> digunakan untuk mengambil beberapa bagian dari sebuah string.\r\n<h1>Parameter</h1>\r\nDalam fungsi <strong>substr </strong>terdapat 3 parameter.\r\n<pre>substr($string, $start, $length);</pre>\r\n<h6>$string (string)</h6>\r\nString yang akan diambil bagiannya.\r\n<h6>$start (int)</h6>\r\nPosisi mulainya pengambilan bagian.\r\n<h6>$length (int) #optional</h6>\r\nPanjangnya karakter yang akan diambil.\r\nApabila parameter $length tidak diberikan sebuah nilai maka otomatis panjangnya bagian yang akan diambil dimulai dari parameter $start sampai string tersebut berakhir <strong>(lebih jelasnya dapat dilihat di contoh 3)</strong>.\r\n<h1>Contoh Penggunaan</h1>\r\nPosisi string dalam PHP dimulai dari 0. Misalnya ada sebuah string \"qweasdzxc\" maka:\r\n\"q\" adalah posisi ke-0\r\n\"w\" adalah posisi ke-1\r\n\"e\" adalah posisi ke-2\r\n\"a\" adalah posisi ke-3\r\n\"s\" adalah posisi ke-4\r\n\"d\" adalah posisi ke-5\r\n\"z\" adalah posisi ke-6\r\n\"x\" adalah posisi ke-7\r\n\"c\" adalah posisi ke-8\r\n<h6>Contoh 1</h6>\r\n<pre>&lt;?php\r\n$string = \"qweasdzxc\";\r\necho substr($string, 0, 3); // output \"qwe\"</pre>\r\nDisediakan sebuah string \"qweasdzxc\". Pengambilan bagian string dimulai dari <strong>posisi 0 (huruf \"q\")</strong> sepanjang <strong>3</strong> karakter, maka dihasilkanlah output \"qwe\".\r\n<h6>Contoh 2</h6>\r\n<pre>&lt;?php\r\n$string = \"qweasdzxc\";\r\necho substr($string, 3, 3); // output \"asd\"</pre>\r\nDisediakan sebuah string \"qweasdzxc\". Pengambilan bagian string dimulai dari <strong>posisi 3 (huruf \"a\")</strong> sepanjang <strong>3</strong> karakter, maka dihasilkanlah output \"asd\".\r\n<h6>Contoh 3</h6>\r\n<pre>&lt;?php\r\n$string = \"qweasdzxc\";\r\necho substr($string, 3); // output \"asdzxc\"</pre>\r\nDisediakan sebuah string \"qweasdzxc\". Pengambilan bagian string dimulai dari <strong>posisi 3 (huruf \"a\")</strong> <strong>sampai string tersebut berakhir (karena parameter $length dikosongkan)</strong>, maka dihasilkanlah output \"asdzxc\".\r\n<h6>Contoh 4</h6>\r\n<pre>&lt;?php\r\n$string = \"qweasdzxc\";\r\necho substr($string, -3, 2); // output \"zx\"</pre>\r\nDisediakan sebuah string \"qweasdzxc\". Pengambilan bagian string dimulai dari <strong>posisi -3 (huruf \"z\")</strong> sepanjang <strong>2</strong> karakter, maka dihasilkanlah output \"zx\". Pada contoh kali ini kita menggunakan start negatif, maka penghitungan posisinya dihitung dari belakang string dan dimulai dari <strong>-1</strong> sampai <strong>-n</strong> secara berurutan ke depan.','Fungsi substr dalam PHP','','publish','open','open','','substr','','','2018-06-03 04:44:11','2018-06-02 21:44:11','',0,'http://blog.ammarfaizi.net/?p=7',0,'post','',0),(29,1,'2018-06-03 02:42:49','2018-06-02 19:42:49','<p>This is the WPForms preview page. All your form previews will be handled on this page.</p><p>The page is set to private, so it is not publicly accessible. Please do not delete this page :) .</p>','WPForms Preview','','private','closed','closed','','wpforms-preview','','','2018-06-03 02:42:49','2018-06-02 19:42:49','',0,'https://blog.ammarfaizi.net/wpforms-preview/',0,'page','',0),(35,1,'2018-06-03 04:37:06','2018-06-02 21:37:06','<h1><strong>strlen</strong></h1>\r\n<strong>strlen</strong> digunakan untuk menghitung panjang karakter dari sebuah string. Fungsi ini mengembalikan nilai dengan tipe data integer (angka).\r\n<h1>Parameter Fungsi</h1>\r\nDalam fungsi <strong>strlen </strong>terdapat 1 parameter.\r\n<pre>strlen($string);</pre>\r\n<h6>$string (string)</h6>\r\nString yang akan dihitung panjang karakternya.\r\n<h1>Contoh Penggunaan</h1>\r\n<h6>Contoh 1</h6>\r\n<pre>&lt;?php\r\n$string = \"abc\";\r\necho strlen($string); // output 3\r\n</pre>\r\nPada contoh tersebut mengeluarkan output <strong>\"3\"</strong> karena panjang karakater string <strong>\"abc\"</strong> adalah <strong>3</strong>.\r\n<h6>Contoh 2</h6>\r\n<pre>&lt;?php\r\n$string = \"abcdef\";\r\necho strlen($string); // output 6\r\n</pre>\r\nPada contoh tersebut mengeluarkan output <strong>\"6\"</strong> karena panjang karakater string <strong>\"abcdef\"</strong> adalah <strong>6</strong>.','Fungsi strlen dalam PHP','','publish','open','open','','strlen','','','2018-06-03 04:49:19','2018-06-02 21:49:19','',0,'https://blog.ammarfaizi.net/?p=35',0,'post','',0),(45,1,'2018-06-03 05:22:51','2018-06-02 22:22:51','<h1><strong>str_repeat</strong></h1>\r\n<strong>str_repeat</strong> digunakan untuk membuat perulangan string dengan jumlah yang ditentukan. Fungsi ini mengembalikan sebuah tipe data berupa string yang telah diulang. Misalnya ada sebuah string \"zxc\", kita dapat mengubahnya menjadi string \"zxczxczxc\" secara langsung dengan menggunakan fungsi str_repeat.\r\n<h1>Parameter Fungsi</h1>\r\nDalam fungsi <strong>str_repeat </strong>terdapat 2 parameter.\r\n<pre>str_repeat($string, $multiplier);</pre>\r\n<h6>$string (string)</h6>\r\nString yang akan dihitung panjang karakternya.\r\n<h6>$multiplier (int)</h6>\r\nJumlah kali string tersebut akan diulang.\r\n<h1>Contoh Penggunaan</h1>\r\n<h6>Contoh 1</h6>\r\n<pre>&lt;?php\r\necho str_repeat(\"abc\", 3); // output \"abcabcabc\"</pre>\r\nPada contoh tersebut mengeluarkan output <strong>\"abcabcabc\"</strong> karena string <strong>\"abc\"</strong> diulang sebanyak 3 kali.\r\n<h6>Contoh 2</h6>\r\n<pre>&lt;?php\r\necho str_repeat(\"!#\", 5); // output \"!#!#!#!#!#\"</pre>\r\nPada contoh tersebut mengeluarkan output <strong>\"!#!#!#!#!#\"</strong> karena string <strong>\"!#\"</strong> diulang sebanyak 3 kali.\r\n<h6>Contoh 2</h6>\r\n<pre>&lt;?php\r\necho \"A\".str_repeat(\"m\", 2).\"ar Faizi\"; // output \"Ammar Faizi\"</pre>\r\nPada contoh tersebut mengeluarkan output <strong>\"Ammar Faizi\"</strong>. Pada contoh ini terdapat 3 string yang digabungkan. Yaitu <strong>\"A\"</strong>, <strong>\"mm\" </strong>yang dihasilkan oleh<strong> str_repeat</strong> dan <strong>\"ar Faizi\"</strong>. Penggabungan string disebut dengan concatenation.','Fungsi str_repeat dalam PHP','','publish','open','open','','str_repeat','','','2018-06-03 05:35:07','2018-06-02 22:35:07','',0,'https://blog.ammarfaizi.net/?p=45',0,'post','',4),(53,1,'2018-06-03 18:36:05','2018-06-03 11:36:05','','Default Theme','','publish','closed','closed','','default-theme','','','2018-06-03 18:36:05','2018-06-03 11:36:05','',0,'https://blog.ammarfaizi.net/popup_theme/default-theme/',0,'popup_theme','',0),(54,1,'2018-06-03 18:36:06','2018-06-03 11:36:06','','Light Box','','publish','closed','closed','','lightbox','','','2018-06-03 18:36:06','2018-06-03 11:36:06','',0,'https://blog.ammarfaizi.net/popup_theme/lightbox/',0,'popup_theme','',0),(55,1,'2018-06-03 18:36:06','2018-06-03 11:36:06','','Enterprise Blue','','publish','closed','closed','','enterprise-blue','','','2018-06-03 18:36:06','2018-06-03 11:36:06','',0,'https://blog.ammarfaizi.net/popup_theme/enterprise-blue/',0,'popup_theme','',0),(56,1,'2018-06-03 18:36:07','2018-06-03 11:36:07','','Hello Box','','publish','closed','closed','','hello-box','','','2018-06-03 18:36:07','2018-06-03 11:36:07','',0,'https://blog.ammarfaizi.net/popup_theme/hello-box/',0,'popup_theme','',0),(57,1,'2018-06-03 18:36:07','2018-06-03 11:36:07','','Cutting Edge','','publish','closed','closed','','cutting-edge','','','2018-06-03 18:36:07','2018-06-03 11:36:07','',0,'https://blog.ammarfaizi.net/popup_theme/cutting-edge/',0,'popup_theme','',0),(58,1,'2018-06-03 18:36:07','2018-06-03 11:36:07','','Framed Border','','publish','closed','closed','','framed-border','','','2018-06-03 18:36:07','2018-06-03 11:36:07','',0,'https://blog.ammarfaizi.net/popup_theme/framed-border/',0,'popup_theme','',0),(59,1,'2018-06-03 11:41:17','0000-00-00 00:00:00','','widget_image','','draft','closed','closed','','','','','2018-06-03 11:41:17','0000-00-00 00:00:00','a:1:{s:12:\"_multiwidget\";i:1;}',0,'https://blog.ammarfaizi.net/?post_type=jetpack_migration&p=59',0,'jetpack_migration','',0),(60,1,'2018-06-03 11:41:17','0000-00-00 00:00:00','','sidebars_widgets','','draft','closed','closed','','','','','2018-06-03 11:41:17','0000-00-00 00:00:00','a:2:{s:19:\"wp_inactive_widgets\";a:0:{}s:9:\"sidebar-1\";a:6:{i:0;s:8:\"search-2\";i:1;s:14:\"recent-posts-2\";i:2;s:17:\"recent-comments-2\";i:3;s:10:\"archives-2\";i:4;s:12:\"categories-2\";i:5;s:6:\"meta-2\";}}',0,'https://blog.ammarfaizi.net/?post_type=jetpack_migration&p=60',0,'jetpack_migration','',0),(65,1,'2018-07-14 16:19:06','0000-00-00 00:00:00','','Pengenalan MySQL','','draft','open','open','','','','','2018-07-14 16:19:06','2018-07-14 09:19:06','',0,'https://blog.ammarfaizi.net/?p=65',0,'post','',0),(66,1,'2018-07-14 16:24:52','2018-07-14 09:24:52','Sebagai seorang developer kita harus mengetahui secara up to date tentang bahasa pemrograman yang populer saat ini. Meskipun kita tidak bisa menguasai semua bahasa dengan maksimal paling tidak kita bisa mengenalnya. Untuk menguasai banyak bahasa pemrograman tentunya bukanlah hal yang mudah. Namun setidaknya kita memiliki spesialisasi pada salah satu dari mereka. Hal yang penting salah satunya adalah skill SQL.\n\nPemahaman yang baik tentang structured query language (SQL) menjadi hal yang sangat penting karena SQL adalah bahasa yang kita gunakan untuk berkomunikasi dengan database.\n\nSayangnya kenyataan berkata lain, peningkatan skill SQL menjadi prioritas paling akhir karena kebanyakan programmer terlalu fokus pada hal lain yang lebih menarik seperti:\n- Meningkatkan skill bahasa pemrograman tertentu.\n- Membuat user interface yang atraktif dan user-friendly.\n- Membuat aplikasi yang bisa berjalan di database apapun.\n- dan sebagainya...\n\nHal tersebut mengakibatkan beberapa masalah berikut...\n\n<blockquote>\n  Pertama, kebanyakan programmer menjadi kurang piawai meracik SQL. Pengetahuan tentang SQL statement hanya sebatas perintah SELECT, INSERT, UPDATE, dan DELETE sederhana saja tanpa memanfaatkan JOIN ataupun clause-clause yang kompleks lainnya. Sehingga SQL statement yang dibuat terkesan asal jadi tanpa memperhatikan performa dan keteraturan data.\n  Kedua, kebanyakan programmer tidak memanfaatkan kemampuan canggih yang dimiliki database engine yang digunakan. Sebagai contoh adalah hanya memanfaatkan database sebagai data store saja dan proses pengolahan data seluruhnya dilakukan di level aplikasi. Padahal seharusnya pemrosesan data bisa diserahkan ke database dengan memanfaatkan aggregate functions, analytical/windowing functions, dan stored procedures.\n  Ketiga, membawa gaya pemrograman prosedural saat memproses data. Sebagai contoh untuk insert data massal masih menggunakan query looping (perulangan) di level aplikasi, akibatnya kinerja aplikasi semakin menurun seiring dengan bertambah banyaknya data. Padahal seharusnya saat kita memproses data di database harus menggunakan paradigma berpikir set (himpunan) dan bulk processing, bukan cara prosedural yang asal jadi.\n</blockquote>\n\nUntuk mengatasi semua masalah di atas, kita sebagai developer harus paham perintah SQL secara luar maupun dalam. Maka dari itu kita perlu membedah isi perintah SQL untuk memahami anatomi-nya.\n\nOk mulai dari perintah-perintah dasar.\nPerintah SQL memiliki struktur dasar yang harus kita pahami agar kita bisa membuat sebuat perintah SQL yang baik dan benar.\n\nPerintah SQL terdiri dari beberapa bagian. Terminologi berikut ini tidak perlu dihafalkan tapi harus diketahui dan dipahami, yaitu\n- Statement/Query\n- Clause\n- Predicate\n- Expression\n\n<blockquote>\n  Statement atau biasa disebut sebagai query, adalah keseluruhan perintah itu sendiri.\n  Clause adalah potongan perintah yang diawali kata kunci SQL tertentu, seperti\n  - SELECT cluase.\n  - SET clause.\n  - FROM clause.\n  - UPDATE clause.\n  - WHERE clause.\n  - JOIN clause.\n  - dan sebagainya.\n  Predicate adalah sebuah kalimat matematika berupa perbandingan antara sebuah field dengan field lain, atau perbandingan antara sebuah field dengan nilai tertentu.\n  Expression adalah sebuah kalimat matematika yang menghasilkan sebuah nilai tertentu, atau sebuah konstanta nilai tertentu, misalkan string \'OK\', atau NOW()+10.\n</blockquote>\n\nOk, kita mulai membedah query yang simple.\n\n<code>SELECT code, name FROM employees WHERE salary &gt;= 3000000</code>\n\nIni adalah SELECT clause\n<code>SELECT code, name</code>\n\nIni adalah FROM clause\n<code>FROM employees</code>\n\nIni adalah WHERE clause\n<code>WHERE salary &gt;= 3000000</code>\n\nIni adalah predicate\n<code>salary &gt;= 3000000</code>\n\nDan ini adalah expression\n<code>3000000</code>\n\nMasih gampang kan?\nMudahan bisa dipahami.\n\n&nbsp;','Mengenal MySQL untuk Pemula part 1','','publish','open','open','','mengenal-mysql-untuk-pemula-part-1','','','2018-07-14 16:24:52','2018-07-14 09:24:52','Sebagai seorang developer kita harus mengetahui secara up to date tentang bahasa pemrograman yang populer saat ini. Meskipun kita tidak bisa menguasai semua bahasa dengan maksimal paling tidak kita bisa mengenalnya. Untuk menguasai banyak bahasa pemrograman tentunya bukanlah hal yang mudah. Namun setidaknya kita memiliki spesialisasi pada salah satu dari mereka. Hal yang penting salah satunya adalah skill SQL.\r\n\r\nPemahaman yang baik tentang structured query language (SQL) menjadi hal yang sangat penting karena SQL adalah bahasa yang kita gunakan untuk berkomunikasi dengan database.\r\n\r\nSayangnya kenyataan berkata lain, peningkatan skill SQL menjadi prioritas paling akhir karena kebanyakan programmer terlalu fokus pada hal lain yang lebih menarik seperti:\r\n- Meningkatkan skill bahasa pemrograman tertentu.\r\n- Membuat user interface yang atraktif dan user-friendly.\r\n- Membuat aplikasi yang bisa berjalan di database apapun.\r\n- dan sebagainya...\r\n\r\nHal tersebut mengakibatkan beberapa masalah berikut...\r\n&gt; Pertama, kebanyakan programmer menjadi kurang piawai meracik SQL. Pengetahuan tentang SQL statement hanya sebatas perintah SELECT, INSERT, UPDATE, dan DELETE sederhana saja tanpa memanfaatkan JOIN ataupun clause-clause yang kompleks lainnya. Sehingga SQL statement yang dibuat terkesan asal jadi tanpa memperhatikan performa dan keteraturan data.\r\n&gt; Kedua, kebanyakan programmer tidak memanfaatkan kemampuan canggih yang dimiliki database engine yang digunakan. Sebagai contoh adalah hanya memanfaatkan database sebagai data store saja dan proses pengolahan data seluruhnya dilakukan di level aplikasi. Padahal seharusnya pemrosesan data bisa diserahkan ke database dengan memanfaatkan aggregate functions, analytical/windowing functions, dan stored procedures.\r\n&gt; Ketiga, membawa gaya pemrograman prosedural saat memproses data. Sebagai contoh untuk insert data massal masih menggunakan query looping (perulangan) di level aplikasi, akibatnya kinerja aplikasi semakin menurun seiring dengan bertambah banyaknya data. Padahal seharusnya saat kita memproses data di database harus menggunakan paradigma berpikir set (himpunan) dan bulk processing, bukan cara prosedural yang asal jadi.\r\n\r\nUntuk mengatasi semua masalah di atas, kita sebagai developer harus paham perintah SQL secara luar maupun dalam. Maka dari itu kita perlu membedah isi perintah SQL untuk memahami anatomi-nya.\r\n\r\nOk mulai dari perintah-perintah dasar.\r\nPerintah SQL memiliki struktur dasar yang harus kita pahami agar kita bisa membuat sebuat perintah SQL yang baik dan benar.\r\n\r\nPerintah SQL terdiri dari beberapa bagian. Terminologi berikut ini tidak perlu dihafalkan tapi harus diketahui dan dipahami, yaitu\r\n- Statement/Query\r\n- Clause\r\n- Predicate\r\n- Expression\r\n\r\n&gt; Statement atau biasa disebut sebagai query, adalah keseluruhan perintah itu sendiri.\r\n&gt; Clause adalah potongan perintah yang diawali kata kunci SQL tertentu, seperti\r\n- SELECT cluase.\r\n- SET clause.\r\n- FROM clause.\r\n- UPDATE clause.\r\n- WHERE clause.\r\n- JOIN clause.\r\n- dan sebagainya.\r\n&gt; Predicate adalah sebuah kalimat matematika berupa perbandingan antara sebuah field dengan field lain, atau perbandingan antara sebuah field dengan nilai tertentu.\r\n&gt; Expression adalah sebuah kalimat matematika yang menghasilkan sebuah nilai tertentu, atau sebuah konstanta nilai tertentu, misalkan string \'OK\', atau NOW()+10.\r\n\r\nOk, kita mulai membedah query yang simple.\r\n\r\n<code>SELECT code, name FROM employees WHERE salary &gt;= 3000000</code>\r\n\r\nIni adalah SELECT clause\r\n<code>SELECT code, name</code>\r\n\r\nIni adalah FROM clause\r\n<code>FROM employees</code>\r\n\r\nIni adalah WHERE clause\r\n<code>WHERE salary &gt;= 3000000</code>\r\n\r\nIni adalah predicate\r\n<code>salary &gt;= 3000000</code>\r\n\r\nDan ini adalah expression\r\n<code>3000000</code>\r\n\r\nMasih gampang kan?\r\nMudahan bisa dipahami.\r\n\r\n&nbsp;',0,'https://blog.ammarfaizi.net/?p=66',0,'post','',1),(67,1,'2018-07-14 16:22:00','2018-07-14 09:22:00','Sebagai seorang developer kita harus mengetahui secara up to date tentang bahasa pemrograman yang populer saat ini. Meskipun kita tidak bisa menguasai semua bahasa dengan maksimal paling tidak kita bisa mengenalnya. Untuk menguasai banyak bahasa pemrograman tentunya bukanlah hal yang mudah. Namun setidaknya kita memiliki spesialisasi pada salah satu dari mereka. Hal yang penting salah satunya adalah skill SQL.\n\nPemahaman yang baik tentang structured query language (SQL) menjadi hal yang sangat penting karena SQL adalah bahasa yang kita gunakan untuk berkomunikasi dengan database.\n\nSayangnya kenyataan berkata lain, peningkatan skill SQL menjadi prioritas paling akhir karena kebanyakan programmer terlalu fokus pada hal lain yang lebih menarik seperti:\n- Meningkatkan skill bahasa pemrograman tertentu.\n- Membuat user interface yang atraktif dan user-friendly.\n- Membuat aplikasi yang bisa berjalan di database apapun.\n- dan sebagainya...\n\nHal tersebut mengakibatkan beberapa masalah berikut...\n\n<blockquote>\n  Pertama, kebanyakan programmer menjadi kurang piawai meracik SQL. Pengetahuan tentang SQL statement hanya sebatas perintah SELECT, INSERT, UPDATE, dan DELETE sederhana saja tanpa memanfaatkan JOIN ataupun clause-clause yang kompleks lainnya. Sehingga SQL statement yang dibuat terkesan asal jadi tanpa memperhatikan performa dan keteraturan data.\n  Kedua, kebanyakan programmer tidak memanfaatkan kemampuan canggih yang dimiliki database engine yang digunakan. Sebagai contoh adalah hanya memanfaatkan database sebagai data store saja dan proses pengolahan data seluruhnya dilakukan di level aplikasi. Padahal seharusnya pemrosesan data bisa diserahkan ke database dengan memanfaatkan aggregate functions, analytical/windowing functions, dan stored procedures.\n  Ketiga, membawa gaya pemrograman prosedural saat memproses data. Sebagai contoh untuk insert data massal masih menggunakan query looping (perulangan) di level aplikasi, akibatnya kinerja aplikasi semakin menurun seiring dengan bertambah banyaknya data. Padahal seharusnya saat kita memproses data di database harus menggunakan paradigma berpikir set (himpunan) dan bulk processing, bukan cara prosedural yang asal jadi.\n</blockquote>\n\nUntuk mengatasi semua masalah di atas, kita sebagai developer harus paham perintah SQL secara luar maupun dalam. Maka dari itu kita perlu membedah isi perintah SQL untuk memahami anatomi-nya.\n\nOk mulai dari perintah-perintah dasar.\nPerintah SQL memiliki struktur dasar yang harus kita pahami agar kita bisa membuat sebuat perintah SQL yang baik dan benar.\n\nPerintah SQL terdiri dari beberapa bagian. Terminologi berikut ini tidak perlu dihafalkan tapi harus diketahui dan dipahami, yaitu\n- Statement/Query\n- Clause\n- Predicate\n- Expression\n\n<blockquote>\n  Statement atau biasa disebut sebagai query, adalah keseluruhan perintah itu sendiri.\n  Clause adalah potongan perintah yang diawali kata kunci SQL tertentu, seperti\n  - SELECT cluase.\n  - SET clause.\n  - FROM clause.\n  - UPDATE clause.\n  - WHERE clause.\n  - JOIN clause.\n  - dan sebagainya.\n  Predicate adalah sebuah kalimat matematika berupa perbandingan antara sebuah field dengan field lain, atau perbandingan antara sebuah field dengan nilai tertentu.\n  Expression adalah sebuah kalimat matematika yang menghasilkan sebuah nilai tertentu, atau sebuah konstanta nilai tertentu, misalkan string \'OK\', atau NOW()+10.\n</blockquote>\n\nOk, kita mulai membedah query yang simple.\n\n<code>SELECT code, name FROM employees WHERE salary &gt;= 3000000</code>\n\n&nbsp;\n\n&nbsp;','Mengenal MySQL untuk Pemula','','inherit','closed','closed','','66-revision-v1','','','2018-07-14 16:22:00','2018-07-14 09:22:00','Sebagai seorang developer kita harus mengetahui secara up to date tentang bahasa pemrograman yang populer saat ini. Meskipun kita tidak bisa menguasai semua bahasa dengan maksimal paling tidak kita bisa mengenalnya. Untuk menguasai banyak bahasa pemrograman tentunya bukanlah hal yang mudah. Namun setidaknya kita memiliki spesialisasi pada salah satu dari mereka. Hal yang penting salah satunya adalah skill SQL.\r\n\r\nPemahaman yang baik tentang structured query language (SQL) menjadi hal yang sangat penting karena SQL adalah bahasa yang kita gunakan untuk berkomunikasi dengan database.\r\n\r\nSayangnya kenyataan berkata lain, peningkatan skill SQL menjadi prioritas paling akhir karena kebanyakan programmer terlalu fokus pada hal lain yang lebih menarik seperti:\r\n- Meningkatkan skill bahasa pemrograman tertentu.\r\n- Membuat user interface yang atraktif dan user-friendly.\r\n- Membuat aplikasi yang bisa berjalan di database apapun.\r\n- dan sebagainya...\r\n\r\nHal tersebut mengakibatkan beberapa masalah berikut...\r\n&gt; Pertama, kebanyakan programmer menjadi kurang piawai meracik SQL. Pengetahuan tentang SQL statement hanya sebatas perintah SELECT, INSERT, UPDATE, dan DELETE sederhana saja tanpa memanfaatkan JOIN ataupun clause-clause yang kompleks lainnya. Sehingga SQL statement yang dibuat terkesan asal jad